import { Box } from "@mui/material";
import { themes } from "../../../config/icons";

const body = () =>{

    const themeMode = themes.light

    return (
        <Box
            display="flex"
            padding="0px 8px"
            
        >
            <Box 
                flex={1}
                    
            >
                <Box component={"img"} src={themeMode.imagen.imgnovia} width="100%"/>
            </Box>
            <Box flex={1}>
                <Box component={"img"} src={themeMode.imagen.imgnadando}/>
            </Box>
        </Box>
    );
}

export default body;
